So far, the "building" side of things has been left under the carpet. It is actually not very complicated. We have: A processor, MyProcessor. A binding for which we want to build this processor, for instance a Python or VST3 binding. What CMake does is that it generates a small .cpp file that combines both. Here is for instance how it is done for Python: /* SPDX-License-Identifier: GPL-3.0-or-later */ #include <@AVND_MAIN_FILE@>
#include <avnd/binding/python/configure.hpp>
#include <avnd/binding/python/processor.hpp> PYBIND11_MODULE(py@AVND_C_NAME@, m)
{ using type = decltype(avnd::configure<python::config, @AVND_MAIN_CLASS@>())::type; static const python::processor< type > instance{m};
} Here, AVND_MAIN_FILE, AVND_C_NAME and AVND_MAIN_CLASS are options that are passed to CMake. For an actual processor though, it's likely that you would have to write your own entrypoint. Here is the Clap entrypoint, which is fairly similar: /* SPDX-License-Identifier: GPL-3.0-or-later */ #include <@AVND_MAIN_FILE@>
