Note that there isn't any direct API call here. Instead, we return user-defined structs: for instance, texture_allocation is simply defined like this: struct texture_allocation
{ // Some keywords to allow the command to be matched to an API call enum { allocation, texture }; // What this call is supposed to return using return_type = texture_handle; // Parameters of the command int binding; int width; int height;
}; The actual concrete type does not matter: the only important thing is for the following to be possible with the returned struct C: // Identify the command
C::allocation; C::texture; // Create a return value
typename C::return_type ret; // Access the parameters of the call
void f(C& command) { int b = command.binding; int w = command.weight; int h = command.height; // etc.
} This allows complete independence from the graphics API, as a node only specifies exactly the allocation / update / draw calls it needs to do in the most generic possible way ; for instance, a node that only allocates and uploads a texture should be easily bindable to any graphics API on earth. An in-progress set of common commands is provided.

