Let's consider the following processor: struct MyProcessor
{ static consteval auto name() { return "Distortion"; } struct { struct { float value; } gain; } inputs; double operator()(double input) { accumulator = std::fmod(accumulator+1.f, 10.f); return std::tanh(inputs.gain.value * input + accumulator); } private: double accumulator{};
}; We have three different values involved: input is the audio sample that is to be processed. inputs.gain.value is an external control which increases or decreases the distortion. accumulator is an internal variable used by the processing algorithm. Now consider this in the context of polyphony: the only thing that we can do is instantiate MyProcessor three times. We cannot call operator() of a single instance on multiple channels, as the internal state must stay independent of the channels. But now the inputs are duplicated for all instances. If we want to implement a filter bank with thousands of duplicated processors in parallel, this would be a huge waste of memory if they all depend on the same gain value. Thus, it is recommended in this case to use the following form: struct MyProcessor
{ static consteval auto name() { return "Distortion"; } struct inputs { struct { float value; } gain; }; struct outputs { }; double operator()(double input, const inputs& ins, outputs& outs) { accumulator = std::fmod(accumulator+1.f, 10.f); return std::tanh(ins.gain.value * input + accumulator); } private: double accumulator{};
}; Here, Avendish will instantiate a single inputs array, which will be shared across all polyphony voices, which will likely use less memory and be more performant in case of large amount of parameters & voices. Here is what I would term the "canonic" of this version, with additionally our helpers to reduce typing, and the audio samples passed through ports instead of through arguments: struct MyProcessor
