I think that this case is pretty nice and a good example of how C++ can greatly improve type safety over C APIs: a common problem for instance with Max or Pd is accessing the incorrect member of an union when iterating the arguments to a message. Avendish has the following method, which transforms a Max or Pd argument list, into an iterable coroutine-based range of std::variant. using atom_iterator = avnd::generator<std::variant<double, std::string_view>>;
inline atom_iterator make_atom_iterator(int argc, t_atom* argv)
{ for (int i = 0; i < argc; ++i) { switch (argv[i].a_type) { case A_FLOAT: { co_yield argv[i].a_w.w_float; break; } case A_SYM: { co_yield std::string_view{argv[i].a_w.w_sym->s_name}; break; } default: break; } }
} Here, atom_iterator is what gets passed to my_variadic_message. It allows to deport the iteration of the loop over the arguments into the calling code, but handles the matching from type to union member in a generic way and transforms them into safer std::variant instances on-the-fly, which removes an entire class of possible errors while not costing much : in my experiments for instance, the compiler is able to elide entirely any form of dynamic memory allocation which would normally be required there.

